import React, { Component } from 'react'
import CourseWork from '../CourseWork/CourseWork'
import Typography from '@material-ui/core/Typography'

interface Idata{
    title?: string,
    teacher?: string,
    deadline?: string,
    scienceArea?: string,
    description?: string,
    reportFile?: string,
    presentationFile?: string,
    consultantReportFile?: string,
    link?: string,
    teacherContacts?: string,
    consultant?: string,
    consultantContacts?: string,
    critic?: string,
    status?: string,
    id? : number
}

interface Props{
    changePage(event : React.MouseEvent<HTMLButtonElement>) : void,
    data :Idata[]
}

interface State{

}

class CompletedWorks extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state={}
    }

    private renderCourseWork(work : Idata){
        return (
            <div style={{marginBottom:'20px'}}>
                <CourseWork data={work} changePage={this.props.changePage}/>
            </div>
        )
    }

    private renderList(){
        return(
            this.props.data.map( work => this.renderCourseWork(work))
        )
    }

    render(){
        return (
        this.props.data[0] === undefined?
            this.renderList()
        : <div style={{textAlign:"center"}}><Typography variant='h5'>Нет завершенных курсовых работ</Typography></div>
        )
    }
}

export default CompletedWorks
